import React from "react";
import { Link } from "react-router-dom";
import "./Select.css";
import SabosImg from "../../assets/1sabos.png";
import SaboresImg from "../../assets/2sabores.png";
import returnImg from "../../assets/return.png";

const Select = () => {
  return (
    <div className="Select">
      <div className="selectmain">
        <header className="head">
          <Link className="return" to="/preferential">
            <img src={returnImg} className="" alt="logo" />
          </Link>
          <h1 className="headh1"> Escolha Inteira ou 2 Sabores </h1>
        </header>

        <div className="selects">
          <div className="select_">
            <Link className="Sabos" to="/tipo">
              <img src={SabosImg} className="" alt="logo" />
            </Link>
            <h2> 1 Sabos </h2>
          </div>

          <div className="select_">
            <Link className="Sabores2" to="/tipo">
              <img src={SaboresImg} className="" alt="" />
            </Link>
            <h2> 2 Sabores </h2>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Select;
